import React, {useContext} from 'react'
import { NewsContext } from '../NewsContext';
import NewsArticle from './NewsArticle';

function News() {
    const { data } = useContext(NewsContext);

  return (
      <div>{data.map(news => (
          <NewsArticle data={news} />
          
      ))} </div>
  )
}

export default News
